import React, { useState } from 'react';

function SetSelection(props) {
  const [selectedSet, setSelectedSet] = useState('');

  const handleChange = (event) => {
    setSelectedSet(event.target.value);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    props.onStartDraft(selectedSet);
  }

  return (
    <form onSubmit={handleSubmit}>
        <div className="Buttons">
            <button type="submit" className="mainButtons">Create Draft</button>
            <button type="submit" className="mainButtons">Join Draft</button>
            <button type="submit" className="mainButtons">Settings</button>
        </div>
    </form>
  );
}

export default SetSelection;
